import React from 'react';
import { useLocation } from 'react-router-dom';

function Dom_select() {
  const location = useLocation();
  const rooms_students = location.state ? location.state.rooms_students : null;  // Changed from 'data' to 'rooms_students'

  return (
    <div>
      {rooms_students ? (
        <div>
          <h1>Room Details</h1>
          <p>Room ID: {rooms_students.Room_ID}</p>
          {/* Display other data as needed */}
        </div>
      ) : (
        <p>No data available.</p>
      )}
    </div>
  );
}

export default Dom_select;
